}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <g>    <polygon points="8 8 3 8 3 10 10 10 10 3 8 3 8 8" fill="#fff"/>    <polygon points="15 8 15 3 13 3 13 10 20 10 20 8 15 8" fill="#fff"/>    <polygon points="13 20 15 20 15 15 20 15 20 13 13 13 13 20" fill="#fff"/>    <polygon points="3 15 8 15 8 20 10 20 10 13 3 13 3 15" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
        export const SvgComponent = React.memo(SvgComp);
